import React from 'react';
import './App.css';
import Login from './components/Login'
import HomeContainer from './components/HomeContainer'
import {BrowserRouter, Route} from 'react-router-dom'

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Route exact to={"http://localhost:3000"} component={Login}></Route>
        <Route to={"http://localhost:3000/home"} component={HomeContainer}></Route>
      </BrowserRouter>
      <Login/>
    </div>
  );
}

export default App;
